import axios from "axios";
import { ref } from "vue";

export default async function backend(url) {
  const apiUrl = 'http://localhost:8000/api/';
  const apiData = ref();

  const apiCall = async () => {
    const response = await fetch(apiUrl+"calendar/week")
      .then(res => res.json()).then(resJson => {
      return resJson;
    });
  }
  console.log(await apiCall());

  return {
    apiData
  }
}
